import logo from "./logo.svg";
import "./App.css";
import PhotoPage from "./components/PhotoPage";

function App() {
  return (
    <div style={{ padding: "4% 4px", width: "100vw" }}>
      <div style={{ display: "flex", justifyContent: "space-between" }}>
        <span>Everyone's photos</span>
        <span style={{ color: "#1c5591" }}>View all 2,724,700</span>
      </div>

      <PhotoPage />
    </div>
  );
}

export default App;
